INSERT INTO information (id, titre, contenu, auteur, idType, dateCreation) VALUES
(1, 'Ouverture des adhésions 2020-2021', '<p>Bonjour à toutes et à tous,</p><p>La nouvelle saison 2020-2021 commence le 1er septembre. Les adhésions et les ré adhésions à l\'amicale du Val de Somme sont désormais ouvertes, afin que chacun puisse s\'engager dans ses bonnes résolutions et ses objectifs annuels.&nbsp;</p><p>Même si bon nombre de compétitions d\'automne sont déjà annulées à cause de la crise sanitaire, l\'adhésion permet de bénéficier de nombreux avantages parmi lesquels :&nbsp;</p><p style=\"margin-left:40px;\">les conseils de coachs formés,&nbsp;</p><p style=\"margin-left:40px;\">le partage d\'expériences de coureurs confirmés,&nbsp;</p><p style=\"margin-left:40px;\">des informations multiples sur la course à pied (calendrier, règlements, conseils...),&nbsp;</p><p style=\"margin-left:40px;\">la pratique en groupe qui soutient les pratiquants dans les périodes où la motivation décline,</p><p style=\"margin-left:40px;\">&nbsp;la participation sous les couleurs du club aux championnats départementaux régionaux et nationaux,&nbsp;</p><p style=\"margin-left:40px;\">les entraînements collectifs variés,&nbsp;</p><p style=\"margin-left:40px;\">les déplacements collectifs &nbsp;et les courses organisées dès leur reprise prochaine,&nbsp;</p><p style=\"margin-left:40px;\">la convivialité des moments festifs qui ponctuent l\'année...,&nbsp;</p><p style=\"margin-left:40px;\">la possibilité aussi de s\'engager dans le bénévolat de la gestion d\'une structure associative.</p><p>Même si la FFA a décidé de prolonger la validité de la licence 2019-2020 jusqu\'au 31 octobre 2020, les nouvelles licences peuvent dès aujourd\'hui être validées et réglées sur notre site www.valdesomme.net (suivez les instructions et documents à remettre).&nbsp;</p><p>Ne perdez pas de temps, cela facilitera le travail de notre secrétariat (et la date de fin de validité sera toujours du 31 août 2021). En conséquence de la crise COVID-19, le conseil d\'administration du club a décidé de proposer une licence à prix modique, et des conditions de ré adhésion exceptionnelles pour les titulaires d\'une licence 2019-2020 (ouvrez votre espace membres pour procéder à votre ré-adhésion).&nbsp;</p><p>Pour toute interrogation, les bénévoles du club se tiennent à votre écoute (contact@valdesomme.net), et seront présents <strong>au salon AGORA du 11 septembre à Amiens</strong>.&nbsp;</p><p>Notez dores-et-déjà l\'organisation du \"<strong>FFA Run-2k challenge</strong>\" : une opération portes-ouvertes qui permettra d\'évaluer son niveau et de rencontrer l\'encadrement sportif du club. Rendez-vous au stade de Camon le <strong>mercredi 16 septembre entre 17h et 20h</strong>.&nbsp;</p><p>Vive la course à pied à l\'amicale du Val de Somme !</p>', 'Dominique Lazure', 1, '2020-08-06 00:00:00'),
(2, 'Courses de la Somme en sursis', '<p>Concernant l\'organisation de plusieurs grandes courses prévues à la rentrée dans le département l\'incertitude subsiste et les organisateurs devraient prendre position début septembre, en particulier pour le mémorial Willecocq a Abbeville prévu le 4 octobre (10km) les 5km 10km et semi marathon de la Somme prévus le 17 octobre et la finale 2020 des 4 saisons (150eme édition anniversaire) prévue le 08 novembre&nbsp;</p><p>Sont dors et déjà annulées :&nbsp;</p><p style=\"margin-left:40px;\">les courses des coquelicots à Albert,&nbsp;</p><p style=\"margin-left:40px;\">les urban trail d\'Amiens et Abbeville,</p><p style=\"margin-left:40px;\">Guignemicourt, Hangest, Saint Blimont, la Moldreuilloise, les virades a Camon, la matelote, la Jules Verne,&nbsp;</p><p style=\"margin-left:40px;\">les trails des vidames et des allumés.</p>', 'Delasalle Jean François', 1, '2020-08-14 00:00:00'),
(3, 'Report de la 150ème édition des 4 saisons d\'Amiens-métropole', '<p><span style=\"color:rgb(0,0,0);\">La course pédestre des 4 saisons d’Amiens-Métropole s’est disputée sans discontinuer depuis 1983 pour un total de 149 éditions. Nous tenons à remercier chaleureusement Amiens-Métropole et nos partenaires pour leur fidèle soutien.</span><br><br><span style=\"color:rgb(0,0,0);\">La célébration de la 150ème édition, avec un programme enrichi et festif, était prévue le 7 juin dernier mais la crise sanitaire actuelle a contraint un premier report au 8 novembre 2020.</span><br><br><span style=\"color:rgb(0,0,0);\">C’est avec regret que nous constatons que les conditions sanitaires et de sécurité, tant pour les participants que pour les spectateurs et pour l’équipe des bénévoles, ne permettent pas encore le tenue de cette 150ème édition. L’édition de la finale du 8 novembre est donc annulée conformément à la décision du comité directeur de l’Amicale du Val de Somme en date du 26 août 2020.</span><br><br><span style=\"color:rgb(0,0,0);\">La 150ème édition des 4 saisons marquera le redémarrage de ces compétitions qui manquent amèrement à nos athlètes. Souhaitons qu’elle intervienne le plus rapidement possible dans le calendrier 2021 : édition hiver du 14 février 2021, printemps du 28 mars 2021, été du 4 juillet 2021 et automne du 7 novembre 2021.&nbsp;</span><br><br><span style=\"color:rgb(0,0,0);\">L’amicale du Val de Somme encourage pour l’instant chaque athlète à continuer sa pratique respectueuse des consignes sanitaires et lui donne rendez-vous pour cette 150ème édition qui sera d’autant plus festive qu’attendue !</span><br><br>&nbsp;</p>', 'Dominique lazure', 1, '2020-08-26 00:00:00'),
(4, 'Programme d\'entrainement du 24 au 30/08/2020', '<p>Bonjour à tous&nbsp;</p><p style=\"margin-left:40px;\">Lundi/Mardi : Footing de 45 mn.&nbsp;</p><p style=\"margin-left:40px;\">Mercredi : Séance de fractionné au stade de Camon de 17H45 à 20H00&nbsp;</p><p style=\"margin-left:80px;\">VMA Courte : (200 X 6) X 3 - RA 45 \'\' - RR 2\'30\'\'&nbsp;</p><p style=\"margin-left:40px;\">Vendredi : Séance de côtes&nbsp;</p><p style=\"margin-left:80px;\">Echauffement 20 mn&nbsp;</p><p style=\"margin-left:80px;\">Choisir une côte avec un pourcentage moyen et faire 14 X 150 mètres,&nbsp;</p><p style=\"margin-left:80px;\">Récupération en descente très très lente,&nbsp;</p><p style=\"margin-left:80px;\">Terminer la séance par une récupération de 15/20 mn&nbsp;</p><p style=\"margin-left:40px;\">Week-end : Sortie longue de 1H30 à 1H45 en allure fondamentale ( 60/65 % de la VMA)&nbsp;</p><p>Bon courage à tous</p><p>&nbsp;Vos coachs</p>', 'Eric DECLERCQ', 3, '2020-08-26 00:00:00'),
(6, 'Annulations en séries', '<p style=\"margin-left:10px;\">Suite a la pandémie COVID et aux contraintes sanitaires d\'organisation les annulations de courses se succèdent chaque jour.</p><p style=\"margin-left:10px;\">En France les championnats de France de cross, de semi marathon et de marathon ont été annulées, le marathon et semi marathon de Paris également ainsi que de très nombreuses courses. Si vous êtes inscrits à une épreuve vérifiez bien auprès des organisateurs si elle a lieu et les conditions éventuelles concernant votre inscription en cas de report.</p><p style=\"margin-left:10px;\">Dans la région et le département il en est de même : consultez la mise a jour du calendrier sur Courses80, il évolue constamment et il est&nbsp; fort probable qu\'il n y aura que très peu de courses organisées d\'ici la fin de l\'année.</p><p style=\"margin-left:10px;\">A l\'étranger plusieurs grands marathons internationaux ont été annulé également et envisagent une édition 2021 avec une participation très restreinte réservée à une élite internationale (150 à 200 coureurs à Londres par exemple).</p><p style=\"margin-left:10px;\">Vivement un monde meilleur débarrassé de ce foutu virus, mais il faudra être patient.</p><p style=\"margin-left:10px;\">Plus que jamais protégez vous et vos proches, sortez masqués et évitez les rassemblements</p>', 'Jean François Delasalle', 1, '2020-06-15 00:00:00'),
(7, 'Report de la 150ème édition des 4 saisons d\'Amiens-métropole', '<p><span style=\"color:rgb(0,0,0);\">La course pédestre des 4 saisons d’Amiens-Métropole s’est disputée sans discontinuer depuis 1983 pour un total de 149 éditions. Nous tenons à remercier chaleureusement Amiens-Métropole et nos partenaires pour leur fidèle soutien.</span><br><br><span style=\"color:rgb(0,0,0);\">La célébration de la 150ème édition, avec un programme enrichi et festif, était prévue le 7 juin dernier mais la crise sanitaire actuelle a contraint un premier report au 8 novembre 2020.</span><br><br><span style=\"color:rgb(0,0,0);\">C’est avec regret que nous constatons que les conditions sanitaires et de sécurité, tant pour les participants que pour les spectateurs et pour l’équipe des bénévoles, ne permettent pas encore le tenue de cette 150ème édition. L’édition de la finale du 8 novembre est donc annulée conformément à la décision du comité directeur de l’Amicale du Val de Somme en date du 26 août 2020.</span><br><br><span style=\"color:rgb(0,0,0);\">La 150ème édition des 4 saisons marquera le redémarrage de ces compétitions qui manquent amèrement à nos athlètes. Souhaitons qu’elle intervienne le plus rapidement possible dans le calendrier 2021 : édition hiver du 14 février 2021, printemps du 28 mars 2021, été du 4 juillet 2021 et automne du 7 novembre 2021.</span><br><br><span style=\"color:rgb(0,0,0);\">L’amicale du Val de Somme encourage pour l’instant chaque athlète à continuer sa pratique respectueuse des consignes sanitaires et lui donne rendez-vous pour cette 150ème édition qui sera d’autant plus festive qu’attendue !</span></p>', 'Dominique Lazure', 2, '2020-05-20 00:00:00'),
(8, 'Les 4 saisons : une finale bien arrosée', '<p>&nbsp;</p><figure class=\"image image-style-side\"><img src=\"http://valdesomme.net/kcfupload/images/10km_premiere_dame_Mull_Jochem%281%29.jpg\" alt=\"\"></figure><p style=\"margin-left:4px;\">Disputées sous une pluie dense les 3 courses de la finale 2019 des 4 saisons&nbsp;ont néanmoins&nbsp;donné lieu à des performances de grande qualité.<br>482 coureurs se sont classés et sont rentrés chez eux bien trempés en ce dimanche d\'automne un peu maussade. Heureusement la chaleur était dans les coeurs et les jambes.</p><figure class=\"image\"><img src=\"http://valdesomme.net/kcfupload/images/10km_premier_homme_Dubreucq.jpg\" alt=\"\"></figure><p style=\"margin-left:4px;\"><br>La course phare a été une nouvelle fois remportée par Antoine Dubreucq (VDS) leader de bout en bout devant le champenois Axel Michaut et l\'abbevillois Abdelkarim Abdelmoumane, premier espoir de la course. Chez les dames Mireille Mull Jochem, venue de Saint Germain n\'a pas connu de réelle opposition pour l\'emporter en 39.50 devant Aicha Zouaoui (AUC) et Amelia Cuvellier (Le Touquet TN)..<br>A noter que le team Alisa Nowak, Ludovic Dubreucq et Antoine Dubreucq, récents champions de France par équipes aux 100km il y a 15 jours semblait avoir parfaitement récupéré pour cette course de reprise et fut de nouveau copieusement applaudi.<br>&nbsp;</p><figure class=\"image\"><img src=\"http://valdesomme.net/kcfupload/images/5km_premiere_femme_Gardel_Gwenaelle.jpg\" alt=\"\"></figure><p style=\"margin-left:4px;\">Sur le 5 km une tres belle densite de performances a été enregsitrée malgré la forte pluie, avec 15 coureurs sous les 18 minutes et une belle victoire de Kevin Daniel en 16.22 et de Gwenaelle Depaula en 19.30.. Bravo aux 155 courageux coureurs de 5 km qui ont affronté la plus forte averse le la matinée.</p><figure class=\"image\"><img src=\"http://valdesomme.net/kcfupload/images/5km_premier_homme_Kevin_Daniel.jpg\" alt=\"\"></figure><p style=\"margin-left:4px;\"><br>Grand merci aux 50 bénévoles qui ont tout fait pour faire oublier la météo du jour</p><p style=\"margin-left:4px;\">Les resultats sont en ligne sur ce site (avec les nouvelles catégories des masters par tranches de 5 ans) ainsi que toutes les photos. Merci une nouvelle fois à Jean Pierre, Marie, Sophie et Adilio qui ont bravé les intempéries pour vous les offrir.&nbsp;</p><p>&nbsp;</p>', 'Jean François Delasalle', 2, '2019-11-15 00:00:00'),
(9, 'Les VDS femmes solidaires', '<p style=\"margin-left:10px;\">Bravo aux 21 VDS qui ont bravé le vent à la Hotoie lors du rendez vous annuel de la journée de la femme sur 5km</p><p style=\"margin-left:10px;\">Félicitations à Charlyne, Véronique et Maryse pour leurs victoires en catégorie.</p><p style=\"margin-left:10px;\">Logiquement ce sont nos deux plus jeunes représentantes Charlyne et Méganne qui se sont montrées les plus rapides</p><p style=\"margin-left:10px;\">&nbsp;</p>', 'GUY VERGHOTE', 4, '2020-03-09 00:00:00'),
(10, 'Championnat de France Cross Country', '<figure class=\"image\"><img src=\"http://valdesomme.net/kcfupload/images/85130217_2796324837056697_7089975237340561408_o.jpg\" alt=\"\"></figure><p style=\"margin-left:10px;\">Pierre-Olivier Delattre a terminé&nbsp;Vice Champion de France Police de cross-country cette semaine.</p><p style=\"margin-left:10px;\">Et de plus 3ème par équipe.</p><p style=\"margin-left:10px;\">Bravo à lui et surtout bonne continuation pour cette année qui débute merveilleusement bien.</p><p style=\"margin-left:10px;\">&nbsp;</p>', 'Dominique Lazure', 4, '2020-05-30 00:00:00'),
(12, 'Préconisations d\'organisation des opérations de rentrée', '<p style=\"margin-left:10px;\">La FFA vient de diffuser un document rappelant les mesures sanitaires à prendre pour nos opérations de rentrée (document joint à ce fil).</p><p style=\"margin-left:10px;\">Merci à tous de respecter les gestes barrière et de pratiquer le sport en toute responsabilité.</p><p style=\"margin-left:10px;\">Désormais, chaque regroupement du VDS devra faire l\'objet d\'un recensement précis des participants afin de garder trace des éventuels cas contact. Il en va de la responsabilité de chacun de se plier à cette petite contrainte qui pourrait rendre un grand service à tous en cas d\'apparition d\'un cas parmi nous.</p><p style=\"margin-left:10px;\">En dehors de la pratique sportive proprement dite, le port du masque et l\'utilisation de gel hydro-alcoolique sont de rigueur avant et après cette pratique.</p><p style=\"margin-left:10px;\">La santé de chacun est l\'affaire de tous.</p>', 'Dominique lazure', 3, '2020-09-07 00:00:00'),
(13, 'Programme d\'entrainement du 07 au 13/09/2020', '<p style=\"margin-left:10px;\">Bonjour à tous,</p><p style=\"margin-left:10px;\">Pour information, le VDS organise le 23/09/2020, une soirée piste à Camon avec le choix d\'effectuer un 1000, un 1500 ou un 3000 m</p><p style=\"margin-left:10px;\">Nous vous invitons vivement à participer et à vous entrainer pour &nbsp;cet évenement.&nbsp;</p><p style=\"margin-left:10px;\"><strong>Lundi/mardi :</strong> Footing 45 mn</p><p style=\"margin-left:10px;\"><strong>Mercredi : </strong>Séance de fractionné au stade de Camon de 17H45 à 20H00</p><p style=\"margin-left:10px;\">Pour cette séance nous vous demandons de bien vous échauffer et de participer aux gammes pour</p><p style=\"margin-left:10px;\">éviter toutes blessures.</p><p style=\"margin-left:10px;\">Séance : 4 X 300 avec 4 mn de repos entre chaque fraction</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4 X 200 avec 3 mn de repos entre chaque fraction</p><p style=\"margin-left:10px;\">Chaque fraction se fait à&nbsp;120/130 % de la VMA (si possible)</p><p style=\"margin-left:10px;\">Retour au calme, étirement et gainage .</p><p style=\"margin-left:10px;\"><strong>Vendredi:</strong> Séance spécifique vitesse :&nbsp; Echauffement 20 mn , puis faire&nbsp; 3 X 500 à 100 % VMA avec 500 m de récupération&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; trottée entre chaque fraction. Récuperation 10/15 mn.</p><p style=\"margin-left:10px;\"><strong>Week-end </strong>: SL 1H00/1H15 en endurance fondamentale</p><p style=\"margin-left:10px;\">Bon courage à tous&nbsp;</p><p style=\"margin-left:10px;\">Vos coachs</p>', 'Eric DECLERCQ', 3, '2020-09-06 00:00:00');
INSERT INTO information (id, titre, contenu, auteur, idType, dateCreation) VALUES
(14, 'Mercredi 16 septembre : relevez le défi !', '<p>&nbsp;</p><figure class=\"image\"><img src=\"data:image/jpeg;base64,\"></figure><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Le mercredi 16 septembre 2020, au stade Lucien Jovelin de Camon, l\'Amicale du Val de Somme invite les amateurs de course à pied, qu\'ils soient débutants, réguliers ou avertis, à venir rencontrer le club, ses membres et son staff pour relever le défi du RUN2K challenge organisé par la fédération française d\'athlétisme.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Le défi consiste à courir 2000m sur la piste. Ce test permettra à chacun de situer son niveau et évaluer ainsi son temps potentiel sur les différentes distances des compétitions : 5km 10km, semi ou marathon.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Les inscriptions seront prises sur place et un départ (limité à 10 participants) sera donné chaque quart d\'heure entre 17h et 19h45.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Chaque participant recevra un souvenir de sa participation et une attestation de sa performance, des lots tirés au sort seront distribués.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Les mesures COVID seront respectées, merci d\'arriver en tenue et en respectant les gestes barrière.</span></p><p style=\"margin-left:7.5pt;\"><span style=\"color:black;\">Relevez le défi avec l\'Amicale du Val de Somme !</span></p><p>&nbsp;</p>', 'Bonjour à toutes et à tous,  la commission médical', 5, '2020-09-01 00:00:00');
INSERT INTO information (id, titre, contenu, auteur, idType, dateCreation) VALUES
(15, 'Un ami nous a quitté', '<p style=\"margin-left:10px;\">Fernand DECAMBRON nous a quitté fin mai à l\'aube de ses 90 ans.</p><p style=\"margin-left:10px;\">Seuls les anciens coureurs connaissait Fernand qui fut licencié au club dans les années 1980-2000.</p><p style=\"margin-left:10px;\">Originaire de Poulainville, outre une grande discrétion Fernand était un excellent coureur qui a longtemps détenu le record V3 (plus de 60 ans) des 4 saisons en 37.29 réalisé en 1990.</p><p style=\"margin-left:10px;\">Il a participé 14 fois aux 10km des 4 saisons avec un record personnel à 35.42 en V2 à plus de 50 ans.</p><p style=\"margin-left:10px;\">4 fois finisher des 100km du Val de Somme il détenait un record personnel à 8h30 réalisé en 1984 en V2</p><p style=\"margin-left:10px;\">Son petit fils Antoine a participé 3 fois aux 4 saisons, venant de la région parisienne pour battre le record de son grand père, sous ses yeux,&nbsp;en avril 2016 avec un chrono de 34.11&nbsp;</p><p style=\"margin-left:10px;\">Adieu Fernand , les générations passent, la relève est là.</p>', 'Jean François Delasalle', 5, '2020-06-14 00:00:00'),
(16, 'Déconfinement : les recommandations FFA', '<p style=\"margin-left:10px;\">Bonjour à toutes et à tous,</p><p style=\"margin-left:10px;\">la commission médicale de la FFA, présidée par le Dr François Perla, vient de publier des recommandations pour la stratégie de déconfinement et les activités athlétiques. Le document (lien ci-dessous) est scientifiquement étayé mais reste néanmoins parfaitement accessible à celles et ceux qui prendront le temps de le parcourir.</p><p style=\"margin-left:10px;\">C\'est sur ces recommandations que le Val de Somme basera ses décisions à venir sur l\'organisation de ses activités.</p><p style=\"margin-left:10px;\">Pour l\'instant, et probablement jusque fin août au minimum, la pratique reste solitaire, et le respect de la distanciation physique de 10 mètres reste plus que jamais en vigueur pour le bien de toutes et tous. Continuons à faire preuve de citoyennenté.</p><p style=\"margin-left:10px;\">Bonnes sorties solitaires, prenez soin de votre santé.</p>', 'Dominique Lazure', 5, '2020-05-10 00:00:00'),
(17, 'Résultats du RUN2K challenge du Val de Somme', '<p style=\"margin-left:10px;\">Grand merci à la soixantaine de participants qui sont venus se tester sur 2000m dans le cadre de l\'opération fédérale Run2K challenge.</p><p style=\"margin-left:10px;\">Merci également à tous d\'avoir respecté au mieux les gestes barrières et le port du masque dans ces temps diffciles où très peu de courses ont lieu..</p><p style=\"margin-left:10px;\">Chacun a pu participer à son niveau sous les encouragements des amis et supporters du club et des clubs voisins (merci au passage au club de l US Camon athlétisme d\'avoir accepté de nous proposer ses locaux pour le secrétariat)</p><p style=\"margin-left:10px;\">Les résultats détaillés sont en piece jointe (pour plus de conseils consultez les encadrants du club).</p><p style=\"margin-left:10px;\">Nous vous rappelons également que le mercredi 23 septembre prochain aura lieu une soirée de demi fond sur ce meme stade de Camon à partir de 19 h avec au programme 1000m , 1500m et 3000 m , ces distances peuvent également servir à mieux élvaluer votre niveau de VMA (surtout le 1500m). Inscriptions sur place (licence FFA obligatoire 2020 ou 2021).</p>', 'GUY VERGHOTE', 5, '2020-09-20 19:45:12'),
(18, 'Résultats de la soirée piste VDS du 23 09 2020 au stade de Camon', '<p style=\"margin-left:10px;\">Malgré la météo très menaçante nous avons échappé de peu à l\'orage pour cette unique soirée demi fond de l\'année 2020 alors qu\'habituellement nous en organisons 3 ou 4 chaque année &nbsp;depuis 2011 dans les mêmes conditions (courses de niveaux, organisation brève avec 2 ou 3 distances seulement proposées).</p><p style=\"margin-left:10px;\">85 coureurs répartis en 6 courses et représentant 12 clubs différents ont participé,</p><p style=\"margin-left:10px;\">Parmi les principales performances de la soirée on retiendra surtout les 2.39.0 au 1000m du minime de Noyon Ayub Hamid Ali devant son coéquipier également minime Quentin Defer en 2.41.4, les 8.50.0 au 3000m de Jean Jacques Trogneux (AUC), les chronos prometteurs au 1000 m de la cadette Tara Lepinoy (USC) 3.16.2&nbsp;et de la minime Charlyne Poquet (VDS) 3.23.9, ainsi que le 10.52 au 3000m de Saliha Rarbi en masters</p><p style=\"margin-left:10px;\">Merci à tous et rendez vous en mai 2021 sous une belle météo printanière et si le Covid nous le permet.</p><p style=\"margin-left:10px;\">Tous les résultats en pièce jointe</p>', 'GUY VERGHOTE', 3, '2020-09-25 18:47:15'),
(19, 'PROGRAMME D\'ENTRAINEMENT DU 21/09 AU 27/09/20', '<p style=\"margin-left:10px;\">Bonjour à tous et désolé pour le retard</p><p style=\"margin-left:10px;\">Lundi/Mardi : Footing cool de 45 mn avec quelques accelerations de 100/150 m en fin de séance</p><p style=\"margin-left:10px;\">MERCREDI : A ne pas manquer, notre soirée piste au stade de Camon, venez nombreux vous tester sur le 1000, le 1500 ou le</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3000 mètres . Première course à 19H00 .&nbsp; On vous attend dès 18H00 pour l\'inscription, l\'échauffement et pourquoi pas une série&nbsp;</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; gammes avant de vous élancer sur la piste.</p><p style=\"margin-left:10px;\">&nbsp;</p><p style=\"margin-left:10px;\">Vendredi : Petite de séance de côtes : Echauffement 20 mn, puis choisir une côte moyenne et faire 10 X 150 m 95 % de la VMA et finir par une petite&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;récupération de 10/15 mn.</p><p style=\"margin-left:10px;\">&nbsp;</p><p style=\"margin-left:10px;\">Week-end : SL 1H15 à 1H30 en allure fondamentale</p><p style=\"margin-left:10px;\">&nbsp;</p><p style=\"margin-left:10px;\">Bon courage à tous</p><p style=\"margin-left:10px;\">Vos coachs</p>', 'Eric Declerc', 3, '2020-09-13 19:03:00'),
(20, 'PROGRAMME D\'ENTRAINEMENT DU 28/09 au 04/10/2020', '<p style=\"margin-left:10px;\">Bonjour à tous</p><p style=\"margin-left:10px;\">Lundi/Mardi : Traditionnel footing 45 mn&nbsp;</p><p style=\"margin-left:10px;\">Mercredi : Séance de fractionné&nbsp;au stade de Camon de 17H45 à 20H00</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Séance mixte :&nbsp; (/300/400/500/400/300) X2&nbsp; - RA 50\'\' - 55\'\' - 1\'&nbsp; - RR 3\' entre les deux blocs</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ne pas oublier, l\'échauffement, les gammes, le retour au calme et les étirements.</p><p style=\"margin-left:10px;\">&nbsp;</p><p style=\"margin-left:10px;\">Vendredi :&nbsp; Séance d\'allures : Echauffement 20 mn , puis faire 10 mn VS Semi&nbsp;, puis récupération active de 2 mn , puis&nbsp; faire 10 mn en VS 10 finir</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; par un retour au calme 15 mn&nbsp;</p><p style=\"margin-left:10px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p style=\"margin-left:10px;\">Week-end : Footing allure fondamentale 60% de la VMA 1H30&nbsp;&nbsp;&nbsp;</p><p style=\"margin-left:10px;\">Bon courage à tous</p><p style=\"margin-left:10px;\">Vos coachs</p>', 'Eric Declerc', 3, '2020-09-28 17:15:14');
