INSERT INTO `page` (id, nom, contenu) VALUES
(1, 'Présentation du club', '<p>&nbsp;</p><figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p><span class=\"text-big\">L‘Amicale du Val de Somme&nbsp;<strong>club de course à pied</strong>, crée en 1984, située à Amiens, est affiliée à la Fédération Française d‘Athlétisme (FFA).</span></p><p><span class=\"text-big\">L\'Amicale du Val de Somme permet aux coureurs sur route de&nbsp;<strong>tous niveaux</strong>&nbsp;(jogger du dimanche, débutants, coureurs confirmés, ...) de se regrouper au sein d\'une amicale ou chacun vient&nbsp;<strong>courir librement</strong>, sans obligation de participer à des entraînements ou des compétitions, afin d‘entretenir des relations d‘amitié et de bonne camaraderie et de bénéficier de conseils.</span></p><p>&nbsp;</p><p><span class=\"text-big\">Toutes les formes de courses sont pratiquées&nbsp;<strong>(cross country, route, piste, trail)</strong>&nbsp;à toutes les allures, chaque adhérent organise sa saison sportive comme il le désire sans obligation sportive envers le club.</span></p><p><span class=\"text-big\">L\'Amicale du Val de Somme c\'est également une&nbsp;<strong>équipe technique</strong>, à votre disposition, prête à vous donner tous les conseils d\'entraînement, de préparation, de récupération lors des 3 entraînements et regroupements hebdomadaires, sur les courses ou autres lieux de rencontre.</span></p><p>&nbsp;</p><p><span class=\"text-big\">Le Val de Somme, c\'est aussi une&nbsp;<strong>équipe organisatrice de compétitions dans le département depuis plus de 20 ans</strong>, en particulier à Amiens avec les 10 Kilomètres des 4 Saisons, mais aussi comme&nbsp;<strong>support technique d\'épreuves</strong>&nbsp;organisées par certains de ses membres( Hangest, Rubempré, Villers Bretonneux, Hallencourt, etc...)</span><br><span class=\"text-big\">Le club prend également un part active&nbsp;<strong>dans l\'organisation du Marathon et des 100 Kilomètres de la Somme</strong>&nbsp;(Mesurage, Flèchage, Inscriptions, Chronométrage à puces, etc...)</span></p><p>&nbsp;</p>'),
(2, 'Adhésion au club', '<figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p><strong>L\'adhésion à l\'Amicale du Val de Somme pour la Saison 2020-2021</strong></p><p><strong>Cotisation Saison 2020-2021</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Montant de l\'adhésion pour la saison 2020-2021 avec une licence Running:&nbsp;<strong>50,00 Euros</strong></td></tr><tr><td>&nbsp;</td><td>Montant de l\'adhésion pour la saison 2019-2020 avec une licence Compétition:&nbsp;<strong>65,00 Euros</strong></td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Montant du renouvellement d\'adhésion pour la saison 2020-2021 avec une licence Running:&nbsp;<strong>30,00 Euros</strong></td></tr><tr><td>&nbsp;</td><td>Montant du renouvellement d\'adhésion pour la saison 2019-2020 avec une licence Compétition:&nbsp;<strong>45,00 Euros</strong></td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>Licence FFA saison 2020-2021</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>La licence FFA&nbsp;<strong>Running</strong>&nbsp;ou FFA&nbsp;<strong>Compétition</strong>&nbsp;permet de courir partout en France</td></tr><tr><td>&nbsp;</td><td>Seule la licence FFA Compétition autorise la participation et le classement aux championnats régionaux ou nationaux FFA, route, cross et piste.<br><strong>Attention</strong>: Aucun changement de type de licence ne sera possible après l\'enregistrement informatique effectué</td></tr><tr><td>&nbsp;</td><td>Une fois le formulaire d\'adhésion en ligne saisi, et le certificat médical envoyé par mail, les premières licences 2019-2020 seront saisies et les membres recevront&nbsp;<strong>directement de la FFA par Mail</strong>&nbsp;un fichier joint comportant la nouvelle licence elle-même, à garder et imprimer pour les justificatifs réclamés lors des inscriptions aux courses.<br><strong>Aucun courrier postal ne sera adressé</strong>&nbsp;concernant la licence FFA. Il est donc important&nbsp;<strong>de communiquer correctement et lisiblement</strong>&nbsp;votre dernière adresse Email.<br>La licence 2019-2020&nbsp;<strong>expirera totalement au 31 Octobre 2020</strong>&nbsp;et ne sera plus valable pour les inscriptions aux courses ni pour l\'assurance, à partir du 1 novembre 2020.</td></tr></tbody></table></figure><p><strong>Mutation</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Renseignements en écrivant à l\'adresse mail contact@valdesomme.net</td></tr><tr><td>&nbsp;</td><td>Une mutation sportive FFA est obligatoire si lors de la saison sportive précédente vous étiez dans un autre club FFA</td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>Assurance</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le club a opté pour l\'assurance responsabilité civile proposée par la&nbsp;<strong>FFA</strong></td></tr><tr><td>&nbsp;</td><td>Vous êtes assurés par votre licence FFA dans le cadre des&nbsp;<strong>compétitions</strong>&nbsp;et des&nbsp;<strong>entraînements du club</strong></td></tr><tr><td>&nbsp;</td><td>Le licencié peut souscrire un contrat d\'assurance individuel couvrant les dommages corporels auxquels sa pratique sportive peut l\'exposer, mais elle n\'est pas obligatoire. Le licencié recevra directement à son domicile en même temps que sa licence, un bulletion d\'adhésion aux options complémentaires, à adresser&nbsp;<strong>directement à l\'assurance de la FFA</strong>&nbsp;pour toute souscription supplémentaire souhaitée.</td></tr></tbody></table></figure><p><strong>Autres avantages</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le calendrier des courses pédestres, sera distribué lors des entraînements du club et les courses courant Janvier.</td></tr><tr><td>&nbsp;</td><td>Des infos sur les divers évènements ou réductions offertes par le Val de Somme seront disponibles sur le site du club.</td></tr><tr><td>&nbsp;</td><td>La participation aux différents challenges de courses pédestres (départementaux, régionaux, nationaux) est automatique pour tous les licenciés du club</td></tr><tr><td>&nbsp;</td><td>Transport en car gratuit lors du ou des déplacements officiels du club sur des courses (ex 10Km et semi marathon de Saint Denis en 2019)</td></tr><tr><td>&nbsp;</td><td>Inscription gratuite sur le site du club aux 5Km et 10 Km des 4 Saisons d\'Amiens Métropole</td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>Le club</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>L\'Amicale du Val de Somme est un club affilié à la Fédération Française d\'Athlétisme.</td></tr><tr><td>&nbsp;</td><td>L\'Amicale du Val de Somme permet aux coureurs sur route de tous niveaux (coureurs débutants, loisirs, compétitions) de se regrouper au sein d\'une amicale ou chacun vient courir librement, sans aucune obligation de participer à des entraînements ou compétitions, afin d\'entretenir des relations d\'amitié et de bonne camaraderie.</td></tr><tr><td>&nbsp;</td><td>Toutes les formes de courses sont pratiquées (route, cross country, piste, trail, kec), à tous les niveaux</td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>Les entraînements</strong></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Un entraînement convivial adapté à votre niveau</td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Mardi</td><td>18H00</td><td>Amiens la Hotoie, allée du zoo</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>Mercredi</td><td>18H00</td><td>Stade municipal de Camon</td><td>&nbsp;</td></tr><tr><td>&nbsp;</td><td>Jeudi</td><td>18H00</td><td>Amiens la Hotoie, allée du zoo</td><td>&nbsp;</td></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>'),
(3, 'Bureau du club', '<p>&nbsp;</p><figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p>&nbsp;</p><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Président</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Dominique LAZURE</span><br><span style=\"color:black;\">Email:&nbsp;</span><a href=\"mailto:lazure@free.fr\"><span style=\"color:windowtext;\">lazure@free.fr</span></a></p></td></tr><tr><td colspan=\"2\">&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Secrétaire</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Dominique DAMIENS</span><br><span style=\"color:black;\">Email:&nbsp;</span><a href=\"mailto:contact@valdesomme.net\"><span style=\"color:windowtext;\">contact@valdesomme.net</span></a></p></td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Secrétaire Adjoint</span></p></td><td><p style=\"margin-left:0cm;\">&nbsp;</p></td></tr><tr><td colspan=\"2\">&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Trésorier</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Ludovic TISON</span></p></td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Trésorier adjoint</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Guy VERGHOTE</span></p></td></tr><tr><td colspan=\"2\">&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">1ère Vice-Présidente</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Béatrice CARANTON</span></p></td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">2ème Vice-Président</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Yannick LEFEVRE</span></p></td></tr><tr><td colspan=\"2\">&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Membres</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Thierry ACOULON</span><br><span style=\"color:black;\">Thierry BELLEMERE</span><br><span style=\"color:black;\">Vincent BIVILLE</span><br><span style=\"color:black;\">Eric DECLERCQ</span><br><span style=\"color:black;\">Floryse DELASALLE</span><br><span style=\"color:black;\">Jean François DELASALLE</span><br><span style=\"color:black;\">Céline DEPUILLE</span><br><span style=\"color:black;\">Gael DUPONT</span><br><span style=\"color:black;\">Patrice LEBEAU</span><br><span style=\"color:black;\">Claude SIMIONI</span><br><span style=\"color:black;\">Christian WYCKAERT</span></p></td></tr></tbody></table></figure>'),
(4, 'Entrainements', '<figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p><span style=\"color:#00469C;\"><strong>Avec qui ?</strong></span></p><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Les entraîneurs</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Patrice LEBEAU adresse mail: patricelebeau@free.fr</span><br><span style=\"color:black;\">Eric DECLERCQ adresse mail: declercqdedisse@orange.fr</span></p></td></tr></tbody></table></figure><p><span style=\"color:#00469C;\"><strong>Ou et quand ?</strong></span></p><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">La Hotoie</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Regroupements près de l\'entrée de l\'allée du zoo</span><br><span style=\"color:black;\">le mardi de 18H00 à 19H30</span><br><span style=\"color:black;\">le jeudi de 18H00 à 19H30</span></p></td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\">Stade muncipal de Camon</span></p></td><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Entrainements sur la piste et chemin de halage</span><br><span style=\"color:black;\">le mercredi de 17H45 à 20H00</span><br><span style=\"color:black;\">rendez vous à partir de 17h45 pour échauffement individuel ou collectif, début des gammes à 18h20 précises, début de la séance piste à 18h30 précises</span></p></td></tr></tbody></table></figure>'),
(5, 'Courses en vue', '<p>&nbsp;</p><figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p>Cette rubrique a pour but de vous signaler les courses hors département pour lesquelles certains de nos membres envisagent une participation. Ces sorties ne sont pas celles planifiées par le club. Attention de ne pas pénaliser les courses organisées par l\'amicale et les grands rendez-vous du département. Si vous voulez voir vos projets de course dans cette rubrique, merci de contacter Vincent Biville à l\'adresse vincentbiville@sfr.fr</p><p><strong>Année 2020s</strong></p><p><strong>26 janvier: Marrakech (Maroc)&nbsp;</strong>&gt; Marathon-semi&nbsp;<strong>:&nbsp;</strong>Laetitia Melchior, Sarah Lamy, Isabelle Moreira, José Ledreux, J-P Joly</p><p><strong>26 janvier: Touquet Paris-Plage :&nbsp;Trail D2B &gt;&nbsp;</strong>42 km :Marie-Christine Suel</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <strong>&gt;&nbsp;</strong>24 km:<strong>&nbsp;</strong>Marie Urbaniak, Fanny Leclerc, Gaël Dupont, David Fronval</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <strong>&gt;&nbsp;</strong>11 km :<strong>&nbsp;</strong>Lucie Bara</p><p><strong>9 février : Mesnières en Bray :&nbsp;Trail Fort et Vert&nbsp;</strong>&gt; 34 km :<strong>&nbsp;</strong>Marie-Christine Suel, Christophe Alfred&nbsp;&nbsp;&nbsp;&nbsp; &gt; 27 km: Odile Fatier, Vincent Biville &gt;19 km : Claude Simioni, Lucille Leclercq, Béatrice Nourry, Marie-Sylvette Paré, Laurent Paré</p><p><strong>1er Mars:&nbsp; 4 saisons d\'Hiver</strong></p><p><strong>1er Mars : Auvergne :&nbsp;Trail du Vulcain</strong>&nbsp;&gt; 47 km: Marie-Christine Suel&nbsp; &gt; 20 km: Marie-Sylvette Paré, Laurent Paré</p><p><strong>29 Mars: &nbsp;Alençon Médavy</strong>: Didier Kaeser</p><p>--------------------------------------------------------------------------------------------------------------------------------------------</p><p>CRISE SANITAIRE COVID 19</p><p><strong>29 Mars:&nbsp;Semi marathon de Salouel ANNULE</strong></p><p><strong>5 Avril: Paris &gt; Marathon:</strong>&nbsp;Marie-Christine Sue ANNULEl</p><p><strong>5 Avril : Valenciennes&nbsp;</strong>&gt; 10 km:&nbsp;Frédéric Delangue ANNULE</p><p><strong>12 Avril: Cassel: l\'Alternative Watten-Cassel &gt; Semi-marathon:&nbsp;</strong>David Fronval ANNULE</p><p><strong>19 Avril : Bailleul : Nord Trail Monts de Flandres</strong>&nbsp;&gt; 59 km :<strong>&nbsp;</strong>Marie-Christine Suel ANNULE</p><p><strong>25 Avril:&nbsp;Belves &gt; championnats de France des 100 km:&nbsp;</strong>Vincent Biville ANNULE</p><p><strong>1er Mai: Maroilles&nbsp;</strong>&gt; 20 km: Vincent Hoornaert,&nbsp;ANNULE</p><p><strong>10 Mai: Saumur &gt;&nbsp;</strong>semi-marathon, marathon<strong>:</strong>&nbsp;Odile Fatier, Claude Simioni, Marie Urbaniak, Gael Dupont, Myriam Biville, Vincent Biville, Jenifer Ruis, Valero Angelito, Celine Depuille, David Regnard, Teddy Barbosa Da Silva, David Fronval, Christophe Alfred,&nbsp; ANNULE</p><p><strong>10 Mai: Lille-Lens: Marathon de la route du Louvre:&nbsp;</strong>Béatrice Caranton, Bernard Caranton, Thierry Bellemere&nbsp; ANNULE</p><p><strong>8 mai au 17 mai</strong>:&nbsp;<strong>Trail de la muraille de Chine&nbsp;</strong>&gt; 100 km en 7 étapes (25 000 marches / 4000 m de D+): Sarah Lamy, Frédéric Vue, J-P Joly, José Ledreux ANNULE</p><p><strong>24 Mai: Poitiers &gt; Marathon:</strong>&nbsp;Bruno Druez ANNULE</p><p><strong>31 Mai:&nbsp;Courir la Jules Verne REPORTE AU &nbsp; 11 OCTOBRE puis ANNULE</strong></p><p><strong>7 Juin:&nbsp;La 150eme des 4 Saisons REPORTE AU 8 NOVEMBRE (finale)</strong></p><p><strong>21 Juin: Molsheim&nbsp;</strong>&gt;&nbsp;Marathon, Semi-marathon et 10 km des<strong>&nbsp;Vignobles d\'Alsace</strong>:&nbsp;(sortie organisée par Jean BENOIT) ANNULE</p><p><strong>25,26,27,28 juin : Vannes &gt;Raid Golfe du Morbihan&nbsp;</strong>&gt; Grand Raid 177 km :&nbsp;Odile Fatier, Lucile Leclerc&nbsp;&nbsp;&gt; Raid 87 km:&nbsp;Béatrice Nourry&nbsp;&gt; Ronde des Douaniers 35 km:&nbsp;&nbsp;Claude Simioni&nbsp;&nbsp;&nbsp; ANNULE</p><p><strong>5 Juillet:&nbsp;4 Saisons d\'été&nbsp;&nbsp; ANNULE</strong></p><p><strong>15 Août :Auzat &gt; Marathon du Moncalm (2750m D+):&nbsp;</strong>Vincent Biville&nbsp;&nbsp; ANNULE</p><p><strong>13 Septembre :&nbsp;Sortie du club&nbsp;:&nbsp;Rouen&nbsp;&gt; 5 km, 10 km, semi-marathon, marathon&nbsp;&nbsp; ANNULE</strong></p><p><strong>19 Septembre:&nbsp;Les 3 mares de Guignemicourt&nbsp;&nbsp; ANNULE</strong></p>'),
(6, 'Les officiels', '<figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:#00469C;\">Officiels Fédéraux</span></p></td><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:black;\">Jean François Delasalle</span><br><span class=\"text-big\" style=\"color:black;\">Gérard Rimbaut</span><br><span class=\"text-big\" style=\"color:black;\">Dominique Lazure</span></p></td></tr><tr><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:#00469C;\">Officiels Régionaux</span></p></td><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:black;\">Didier Kaeser</span><br><span class=\"text-big\" style=\"color:black;\">Patrice Lebeau</span><br><span class=\"text-big\" style=\"color:black;\">Sandrine Randon</span><br><span class=\"text-big\" style=\"color:black;\">Laurence Faucheux</span><br><span class=\"text-big\" style=\"color:black;\">Guy Verghote</span></p></td></tr><tr><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:#00469C;\">Officiels Départementaux</span></p></td><td><p style=\"margin-left:0cm;\"><span class=\"text-big\" style=\"color:black;\">Floryse Delasalle</span></p></td></tr></tbody></table></figure>');
INSERT INTO `page` (id, nom, contenu) VALUES
(7, 'Présentation 4 saisons', '<figure class=\"image image-style-align-right\"><img src=\"data:image/gif;base64,\"></figure><figure class=\"image\"><img src=\"data:image/gif;base64,\"></figure><p><strong>Les courses des 4 saisons à Amiens près du Val de Somme (4 fois par an):</strong></p><p>&nbsp;</p><p><i><strong>Calendrier saison 2020-2021</strong></i></p><figure class=\"table\"><table><tbody><tr><td><strong>14/02/2021</strong>&nbsp;Courses des 4 Saisons d\'Hiver <strong>La 150ème course des 4 Saisons</strong></td></tr><tr><td><strong>28/03/2021</strong>&nbsp;Courses des 4 Saisons de printemps</td></tr><tr><td><strong>04/07/2021</strong>&nbsp;Courses des 4 Saisons d\'été</td></tr><tr><td><strong>08/11/2021</strong>&nbsp;Courses des 4 Saisons Finale d\'Automne</td></tr></tbody></table></figure><p><i><strong>Horaires et distances des courses</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td><strong>09h20</strong></td><td>5 Km découverte</td><td>Epreuve ouverte à partir de la catégorie Minimes, coureurs licenciés ou non licenciés.</td></tr><tr><td>&nbsp;</td><td><strong>10h05</strong></td><td>10 Km des joggers</td><td>joggers du dimanche,débutants ou confirmés en&nbsp;45minutes et plus&nbsp;(chronométrage à partir de 44 minutes pour les hommes, le temps réel sera pris en compte pour les féminines). Epreuve ouverte à partir de la catégorie Cadets, coureurs licenciés ou non licenciés.</td></tr><tr><td>&nbsp;</td><td><strong>11h20</strong></td><td>10 Km des as</td><td>Coureurs en moins de 45 minutes. Tous les temps (même supérieurs à 45\'00) sont pris en compte. Epreuve ouverte à partir de la catégorie Cadets, coureurs licenciés ou non licenciés.</td></tr></tbody></table></figure><p><i><strong>Les 3 courses de 5 et 10 km sont inscrites au challenge départemental de la Somme.</strong></i></p><p><i><strong>Classements</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le classement général de l\'épreuve des 10 Kilomètres des 4 saisons est établi à partir de l\'ensemble des temps réalisés sur les 2 épreuves distinctes (10 Km des Joggers et 10 Km des As).<br>Si un coureur participe aux 2 épreuves de 10 Km, son meilleur temps est retenu.<br><strong>Pour les hommes, les temps réalisés sur l\'épreuve des 10 Kilomètres des Joggers inférieurs à 44 minutes sont ramenés à 44 minutes</strong>. Cette clause ne s\'applique pas pour les féminines.</td></tr></tbody></table></figure><p><i><strong>Inscriptions aux courses</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Les inscriptions sont possibles&nbsp;<strong>uniquement en ligne</strong>&nbsp;sur le site du Val de Somme</td></tr><tr><td>&nbsp;</td><td><strong>Le formulaire d\'inscription uniquement en ligne est disponible environ un mois avant la course</strong><br>Toutes les informations de tarifs, dates limites d\'inscription, etc... figurent sur le site à l\'ouverture des inscriptions</td></tr><tr><td>&nbsp;</td><td><strong>Aucune inscription sur place.</strong><br><strong>Plus d\'inscription courrier</strong></td></tr></tbody></table></figure><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>L\' inscription à plusieurs épreuves (5Km et 10 Km) est possible sur le même formulaire d\'inscription. Le coűt est identique que vous participiez à une, deux ou trois épreuves. Vous ne vous acquittez du montant de l\'engagement qu\'une fois, quelque soit le nombre d\'épreuves courues<br>Si vous décidez, après vous être inscrit, de changer de course, ou d\'en courir une de plus ou de moins, inutile de nous prévenir, notre système de chronométrage par puces enregistrera toutes vos participations<br>Vous pouvez également, le jour de la course, changer d\'épreuve, ou en courir une de plus ou de moins. Toutes les épreuves courues se font avec le même dossard et la même puce de chronométrie.<br><strong>Dans tous les cas, ne rendez votre puce qu\'après avoir participé à votre dernière course</strong></td></tr></tbody></table></figure><p><i><strong>Licences ou Certificats Médicaux</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td><strong>Attention:</strong>&nbsp;Seules les licences de la Fédération Française d\'Athlétisme, et de la Fédération UFOLEP Athlétisme ou courses sur route sont admises pour les inscriptions sur les courses hors stade.</td></tr><tr><td>&nbsp;</td><td>Pour tous les autres,&nbsp;sans exception, il sera nécessaire de fournir un certificat médical daté de moins d\'un an au jour de l\'épreuve (ou copie)&nbsp;de non contre indication la pratique de la course à pied en compétition&nbsp;ou&nbsp;de non contre indication la pratique de l\'athlétisme en compétition. Ce document sera gardé obligatoirement pendant un an par l\'organisateur.</td></tr><tr><td>&nbsp;</td><td>Un modèle de certificat médical est disponible en cliquant ici (*)</td></tr></tbody></table></figure><p><i><strong>Retrait des dossards</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le matin, avant le départ des courses, ouverture du secrétariat à 8H30</td></tr><tr><td>&nbsp;</td><td>Si la colonne Lic/Cm apparaît en&nbsp;<strong>vert</strong>&nbsp;dans la liste des inscrits, vous devrez justifier de votre identité (licence, carte d\'identité, ...) pour retirer votre dossard</td></tr><tr><td>&nbsp;</td><td>Si la colonne Lic/Cm apparaît en&nbsp;<strong>rouge</strong>&nbsp;(licence ou certificat médical non présenté),&nbsp;<strong>bleu</strong>&nbsp;(licence saison précédente), ou&nbsp;<strong>ocre</strong>&nbsp;(certificat médical non valide) dans la liste des inscrits, vous devrez présenter votre licence validée ou un certificat médical conforme pour retirer votre dossard. En cas de présentation de certificat médical (ou copie), ce document est gardé par l\'organisation.</td></tr></tbody></table></figure><p><i><strong>Autorisation parentale</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Tous les compétiteurs mineurs doivent présenter un autorisation parentale signée</td></tr><tr><td>&nbsp;</td><td>Un modèle d\'autorisation parentale est disponible en cliquant ici (*)</td></tr></tbody></table></figure><p><i><strong>Parcours</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Le départ des épreuves se situe en contrebas du parc sur le chemin de halage près de l\'écluse<br>Le secrétariat dossard, ainsi que les arrivées des courses se situent sous la halle.</td></tr><tr><td>&nbsp;</td><td>Cliquez ici pour voir ou télécharger la carte du parcours de l\'épreuve de 5 Kilomètres</td></tr><tr><td>&nbsp;</td><td>Cliquez ici pour voir ou télécharger la carte du parcours de l\'épreuve de 10 Kilomètres</td></tr></tbody></table></figure><p><i><strong>Venir</strong></i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td>Pour se rendre sur le lieu de la course, à partir de l\'hopital Nord, prendre la rue de Vignacourt (sens descente), tourner à droite au premier feu (rue St Maurice), et continuer tout droit jusqu\'au Parc.</td></tr><tr><td>&nbsp;</td><td>Depuis Amiens par la rocade Nord direction Abbeville, ou depuis Abbeville par la RN1, prendre la sortie 40 direction Longpré les Amiens, suivre la direction Parc de Loisirs - Camping Parc des Cygnes</td></tr></tbody></table></figure>'),
(8, 'Mensions légales', '<p><i><strong>Mention de droits réservés</strong></i></p><p style=\"margin-left:auto;\">&nbsp;</p><p style=\"margin-left:auto;\">Conformément à la mise place du RGPD en vigeur le 24 mai 2018, les informations vous concernant sont destinées à Esprit Run, responsable du traitement. Vous disposez d’un droit d’accès, de rectification et de suppression des données qui vous concernent. Vous pouvez exercer ce droit en adressant un e-mail à l’adresse électronique suivante :&nbsp;<span style=\"color:rgb(124,179,66);\">espritrun80@gmail.com</span></p><p style=\"margin-left:auto;\">Les informations fournies seront exploitées de manière anonyme et non nominatives à des fins d’analyse et de statistique.</p><p style=\"margin-left:auto;\">En vous connectant à ce site édité et mis en ligne par Esprit Run, vous accédez à un contenu protégé par la loi, notamment par les dispositions du Code de la propriété intellectuelle.</p><p style=\"margin-left:auto;\">Les marques de l’éditeur du site ESPRIT RUN et de ses partenaires, ainsi que les logos figurant sur le site sont des marques déposées. Le téléchargement de tout ou partie des textes, images, sons, photographies, données, marques et tout autre élément contenu est autorisé à des fins strictement privées, dans le cadre scolaire ou pour un usage non commercial.</p><p style=\"margin-left:auto;\">ESPRIT RUN n’autorise qu’un usage strictement personnel des données, informations ou contenus auxquels vous accédez, limité à un enregistrement temporaire sur votre ordinateur aux fins d’affichage sur un seul écran ainsi que la reproduction, en un unique exemplaire, pour copie de sauvegarde ou impression sur papier.</p><p style=\"margin-left:auto;\">Toute autre utilisation est soumise à notre autorisation expresse préalable. En poursuivant votre visite de notre site vous acceptez de respecter les restrictions ci-dessus.</p><p style=\"margin-left:auto;\">Le contenu généré par des tiers (utilisateurs, partenaires) est sous leur entière responsabilité.</p><p style=\"margin-left:auto;\">ESPRIT RUNse réserve le droit de modifier, à tout moment et sans préavis, le contenu de ce site. En outre, ESPRIT RUN décline toute responsabilité en cas de retard, d’erreur ou d’omission quant au contenu des présentes pages de même qu’en cas d’interruption ou de non-disponibilité du service.</p><p style=\"margin-left:auto;\">La création de liens hypertextes vers le site de ESPRIT RUN ainsi que les liens hypertextes établis en direction d’autres sites à partir du site de ESPRIT RUN n’engagent pas la responsabilité de ESPRIT RUN</p><p style=\"margin-left:auto;\">Droits de reproduction et de diffusion réservés ©</p><p>&nbsp;</p><p><i><strong>Conditions Générales d’Utilisation</strong></i></p><p style=\"margin-left:auto;\">&nbsp;</p><p style=\"margin-left:auto;\">Les conditions générales d’utilisation du site HelloAsso sont disponibles à ces adresses</p><p style=\"margin-left:auto;\"><i><strong>Mentions légales</strong></i></p><p style=\"margin-left:auto;\">&nbsp;</p><p style=\"margin-left:auto;\">ESPRIR RUN<br>Siège social :&nbsp;<span style=\"color:rgb(0,0,0);\">12 RUE FREDERIC PETIT 80000 AMIENS</span></p><p style=\"margin-left:auto;\">Association enregistrée sous le numéro&nbsp; <span style=\"color:rgb(35,42,52);\">51266640500034</span></p><p style=\"margin-left:auto;\">Représentant Légal : Mr Guillaume Brianchon Président su club</p><p style=\"margin-left:auto;\">Hébergeur :<br>OVH<br>SAS au capital de 10 069 020 €<br>RCS Lille Métropole 424 761 419 00045<br>Code APE 2620Z<br>N° TVA : FR 22 424 761 419<br>Siège social : 2 rue Kellermann – 59100 Roubaix – France</p><p>&nbsp;</p>'),
(9, 'Politique de confidentialité', '<p><span style=\"color:rgb(51,51,51);\"><i><strong>charte relative relative à la protection des données à caractère personnel des utilisateurs</strong></i></span></p><p>&nbsp;</p><p><i><strong>1 – Définition et nature des données à caractère personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Lors de votre utilisation du site internet accessible à l’adresse&nbsp; <a href=\"http://www.esprtirun.fr/\">www.esprtirun.fr</a> ou sur une “<i>Plateforme</i>“, qui nous permet de gérer les adhésions, nous pouvons être amenés à vous demander de nous communiquer des données à caractère personnel vous concernant, désignant toutes les données qui permettent d’identifier un individu directement ou indirectement.</p><p style=\"margin-left:0px;\">Dans ce cadre, nous collectons les données suivantes :</p><hr><p><i><strong>1.1 – Information que vous nous communiquez</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Pour la bonne exécution des services que nous proposons dans le cadre de nos activités sportives, et notamment les services de paiement, nous collectons les données suivantes :</p><p><strong>Pour les contributeurs :</strong></p><p>&nbsp;</p><ul><li><strong>informations permettant votre identification</strong>&nbsp;lors de l’ouverture de votre compte ou de la réalisation d’un paiement : nom, prénom, adresse e-mail, adresse postale, nationalité, date de naissance ;</li><li><strong>toutes informations strictement réservées à la bonne exécution de nos activités (taille de maillot, taille pour les batons, )</strong></li></ul><hr><p><i><strong>1.2 – Information que nous collectons automatiquement lors de votre utilisation du site</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Lors de votre utilisation du site pour la bonne exécution des services, nous sommes également susceptibles de collecter des données à caractère personnel vous concernant, de manière automatique par l’intermédiaire des outils et services proposés sur le site</p><p><i><strong>2 – Objet de la présente charte</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">La présente charte a pour objet de vous informer sur les moyens que nous mettons en œuvre pour collecter et traiter vos données à caractère personnel, dans le respect le plus strict de vos droits.</p><p style=\"margin-left:0px;\">Nous vous indiquons à ce sujet que nous nous conformons, dans la collecte et la gestion de vos données à caractère personnel, à la loi n° 78-17 du 6 janvier 1978 relative à l’informatique, aux fichiers et aux libertés, dans sa version actuelle, ainsi qu’au Règlement général de protection des données (ci-après “<i>RGPD</i>“).</p><p><i><strong>3 – Identité du responsable de la collecte et du traitement de données</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Le responsable de la collecte et du traitement de vos données à caractère personnel est l’association ESPRIT RUN, association sportive <span style=\"color:rgb(0,0,0);\">ESPRIT RUN, 12 RUE FREDERIC PETIT 80000 AMIENS enregistré sous le numéros</span> SIRET <span style=\"color:rgb(35,42,52);\">51266640500034</span></p><p><i><strong>4 – Collecte et traitement des données à caractère personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vos données à caractère personnel sont collectées et traitées pour répondre à une ou plusieurs des finalités suivantes :</p><ul><li>Gérer votre accès sur le site et aux services accessibles et leur utilisation, ainsi que répondre à toute demande concernant votre utilisation des services,</li><li>Effectuer les opérations relatives à la gestion et au suivi de nos relations avec les utilisateurs, Organisme FFA</li><li>Constituer un fichier de membres inscrits</li><li>Adresser des newsletters ou tous messages informatifs relatifs à notre actualité. Dans le cas où vous ne le souhaiteriez pas, nous vous donnons la faculté d’exprimer votre refus à ce sujet lors de la collecte de vos données ;</li><li>Respecter nos obligations légales et réglementaires, notamment en matière de lutte contre la fraude bancaire. A ce titre, nous avons notamment l’obligation de vérifier ou d’authentifier vos informations collectées lors des opérations de paiement.</li></ul><p style=\"margin-left:0px;\">Nous vous informons, lors de la collecte de vos données personnelles, si certaines données doivent être obligatoirement renseignées ou si elles sont facultatives. Nous vous indiquons également quelles sont les conséquences éventuelles d’un défaut de réponse.</p><p><i><strong>5 – Destinataires des données collectées et traitées</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les membres du bureau, la FFA (pour l’enregistrement officielle des licences) auront accès à vos données à caractère personnel.</p><p style=\"margin-left:0px;\">La FFA pourra les utiliser pour les mêmes finalités et sous les mêmes conditions que celles visées dans la présente Charte. Il reste toutefois seul et uniquement responsable du respect de ses obligations légales et déclaratives dans le cadre du traitement de vos données à caractère personnel qu’il effectue par lui-même, avec ses propres moyens et pour ses seuls besoins. Nous ne sommes responsables que de notre utilisation de vos données à caractère personnel, à l’exclusion de toutes autres utilisations effectuées par l’Organisme.</p><p style=\"margin-left:0px;\">Peuvent également être destinataires de vos données à caractère personnel les organismes publics, exclusivement pour répondre à nos obligations légales, les auxiliaires de justice, les officiers ministériels et les organismes chargés d’effectuer le recouvrement de créances.</p><p><i><strong>6 – Cession des données à caractère personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vos données à caractère personnel ne feront pas l’objet de cessions, locations ou échanges au bénéfice de tiers.</p><p style=\"margin-left:0px;\">Cependant, vous êtes informés que nous nous réservons la possibilité de communiquer à des tiers vos données entièrement anonymisées et sous forme agrégée, c’est-à-dire dans une forme ne permettant pas de vous identifier, de quelque manière que ce soit.</p><p><i><strong>7 – Durée de conservation des données à caractère personnel</strong></i></p><p>&nbsp;</p><p><strong>Concernant les données relatives à la gestion et au suivi des relations avec les utilisateurs de nos services :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vos données à caractère personnel ne seront pas conservées au-delà de la durée strictement nécessaire à la gestion de notre relation avec vous. Toutefois, les données permettant d’établir la preuve d’un droit ou d’un contrat, devant être conservées au titre du respect d’une obligation légale, le seront pendant la durée prévue par la loi en vigueur.</p><p style=\"margin-left:0px;\">Nous conservons vos données pendant un délai maximum de trois (3) ans à compter de la collecte de vos données ou du dernier contact émanant de l’utilisateur ou de la fermeture de votre compte.</p><p><strong>Concernant la gestion des listes d’opposition à recevoir de la prospection :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les informations permettant de prendre en compte votre droit d’opposition sont conservées au minimum trois (3) ans à compter de l’exercice du droit d’opposition.</p><p><strong>Concernant les statistiques de mesure d’audience :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les informations stockées dans le terminal des utilisateurs ou tout autre élément utilisé pour identifier les utilisateurs et permettant leur traçabilité ou fréquentation ne seront pas conservées au-delà de treize (13) mois.</p><p><strong>Concernant l’archivage des données relatives aux opérations bancaires :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">A l’issue de la durée de conservation de vos données telle que précisée ci-dessus, nous vous informons que nous archivons vos données pendant un délai de deux (2) ans pour répondre à nos obligations légales, notamment en termes de lutte contre la fraude bancaire et le blanchiment d’argent.</p><p><i><strong>8 – Sécurité</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Nous vous informons prendre toutes précautions utiles, mesures organisationnelles et techniques appropriées pour préserver la sécurité, l’intégrité et la confidentialité de vos données à caractère personnel et notamment, empêcher qu’elles soient déformées, endommagées ou que des tiers non autorisés y aient accès.</p><p><i><strong>9 – Hébergement</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Nous vous informons que vos données sont conservées et stockées, pendant toute la durée de leur conservation</p><p style=\"margin-left:0px;\">Vos données ne feront l’objet d’aucun transfert en dehors de l’Union européenne dans le cadre de l’utilisation des services que nous vous proposons.</p><p><i><strong>10 – Cookies</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les cookies sont des fichiers textes, souvent cryptés, stockés dans votre navigateur. Ils sont créés lorsque le navigateur d’un utilisateur charge un site internet donné : le site envoie des informations au navigateur, qui crée alors un fichier texte. Chaque fois que l’utilisateur revient sur le même site, le navigateur récupère ce fichier et l’envoie au serveur du site internet.</p><p style=\"margin-left:0px;\">On peut distinguer trois types de cookies, qui n’ont pas les mêmes finalités : les cookies techniques, les cookies des réseaux sociaux et les cookies publicitaires :</p><ul><li>Les cookies techniques sont utilisés tout au long de votre navigation, afin de la faciliter et d’exécuter certaines fonctions. Un cookie technique peut par exemple être utilisé pour mémoriser les réponses renseignées dans un formulaire ou encore les préférences de l’utilisateur s’agissant de la langue ou de la présentation d’un site internet, lorsque de telles options sont disponibles.</li><li>Les cookies des réseaux sociaux peuvent être créés par les plateformes sociales pour permettre aux concepteurs de sites internet de partager le contenu de leur site sur lesdites plateformes. Ces cookies peuvent notamment être utilisés par les plateformes sociales pour tracer la navigation des internautes sur le site internet concerné, qu’ils utilisent ou non ces cookies.</li><li>Les cookies publicitaires peuvent être créés non seulement par le site internet sur lequel l’utilisateur navigue, mais également par d’autres sites internet diffusant des publicités, annonces, widgets ou autres éléments sur la page affichée. Ces cookies peuvent notamment être utilisés pour effectuer de la publicité ciblée, c’est-à-dire de la publicité déterminée en fonction de la navigation de l’utilisateur.</li></ul><p style=\"margin-left:0px;\">Nous utilisons des cookies techniques. Ceux-ci sont stockés dans votre navigateur pour une période de treize (13) mois.</p><p style=\"margin-left:0px;\">Nous utilisons des cookies des réseaux sociaux. Ces cookies ne sont déposés que si vous donnez votre accord. Vous pouvez vous informer sur leur nature, les accepter ou les refuser.</p><p style=\"margin-left:0px;\">Nous vous invitons par ailleurs à consulter les politiques de protection de la vie privée des plateformes sociales à l’origine de ces cookies, pour prendre connaissance des finalités d’utilisation des informations de navigation qu’elles peuvent recueillir grâce à ces cookies et des modalités d’exercice de vos droits auprès de ces plateformes.</p><p style=\"margin-left:0px;\">Nous utilisons également des cookies publicitaires. Ces cookies ne sont déposés que si vous donnez votre accord. Vous avez la possibilité de désactiver ces cookies dans les paramètres de votre navigateur web.</p><p style=\"margin-left:0px;\">Nous utilisons Google Analytics, qui est un outil statistique d’analyse d’audience qui génère des cookies permettant de mesurer le nombre de visites sur la Plateforme, le nombre de pages vues et l’activité des visiteurs. Votre adresse IP est également collectée pour déterminer la ville depuis laquelle vous vous connectez. La durée de conservation de ce cookie est mentionnée à l’article 7 (v) de la présente charte.</p><p style=\"margin-left:0px;\">Nous vous rappelons à toutes fins utiles qu’il vous est possible de vous opposer au dépôt de cookies techniques et des cookies générés par Google Analytics, en configurant votre navigateur. Un tel refus pourrait toutefois empêcher le bon fonctionnement de la Plateforme.</p><p><i><strong>11 – Consentement</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Lorsque vous choisissez de communiquer vos données à caractère personnel aux fins de l’exécution des services que nous proposons par l’intermédiaire de notre site, vous donnez expressément votre consentement pour la collecte et le traitement de celles-ci conformément à ce qui est énoncé à la présente charte et à la législation en vigueur.</p><p><i><strong>12 – Accès à vos données à caractère personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Conformément à la loi n° 78-17 du 6 janvier 1978 relative à l’informatique, aux fichiers et aux libertés, ainsi que de RGPD, vous disposez du droit d’accéder à vos données (article 15 du RGPD) pour en obtenir la communication et le cas échéant en obtenir, la rectification ou l’effacement (articles 16 et 17 du RGPD), à travers un accès en ligne à votre dossier. Vous pouvez également vous adresser à :</p><ul><li>adresse de courrier électronique :&nbsp;<span style=\"color:rgb(124,179,66);\">espritrun80@gmail.com</span></li><li>adresse de courrier postal : <span style=\"color:rgb(0,0,0);\">ESPRIT RUN, 12 RUE FREDERIC PETIT 80000 AMIENS</span></li></ul><p style=\"margin-left:0px;\">Il est rappelé que toute personne peut, pour des motifs légitimes, demander la limitation au traitement des données la concernant (article 18 du RGPD) ou s’opposer audit traitement (articles 21 et 22 du RGPD).</p><p style=\"margin-left:0px;\">Nous vous informerons qu’en cas de rectification ou effacement de vos données à caractère personnel, ainsi que de limitation des traitements, réalisés suite à une demande de votre part, nous notifierons lesdites modifications aux personnes auxquelles nous avons communiqués vos données, à moins qu’une telle communication s’avère impossible (article 19 du RGPD).</p><p><i><strong>13 – Portabilité de vos données à caractère personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vous disposez d’un droit à la portabilité des données à caractère personnel que vous nous aurez fournies, entendues comme les données que vous avez déclarées activement et consciemment dans le cadre de l’accès et de l’utilisation des services, ainsi que des données générées par votre activité dans le cadre de l’utilisation des services (article 20 du RGPD). Nous vous rappelons que ce droit ne porte pas sur les données collectées et traitées sur une autre base légale que le consentement ou l’exécution du contrat nous liant.</p><p style=\"margin-left:0px;\">Ce droit peut être exercé gratuitement, à tout moment, et notamment lors de la fermeture de votre compte, afin de récupérer et de conserver vos données à caractère personnel.</p><p style=\"margin-left:0px;\">Dans ce cadre, nous vous adresserons vos données à caractère personnel, par tous moyens jugés utiles, dans un format ouvert standard couramment utilisé et lisible par machine, conformément à l’état de l’art.</p><p><i><strong>14 – Introduction d’une réclamation devant une autorité de contrôle</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vous êtes également informés que vous disposez du droit d’introduire une réclamation auprès d’une autorité de contrôle compétente, (la Commission Nationale Informatique et Libertés pour la France), dans l’Etat membre dans lequel se trouve votre résidence habituelle, votre lieu de travail ou le lieu où la violation de vos droits aurait été commise, si vous considérez que le traitement de vos données à caractère personnel objet de la présente Charte constitue une violation des textes applicables.</p><p style=\"margin-left:0px;\">Ce recours pourra être exercé sans préjudice de tout autre recours devant une juridiction administrative ou juridictionnelle. En effet, vous disposez également d’un droit à un recours administratif ou juridictionnel effectif si vous considérez que le traitement de vos données à caractère personnel objet de la présente Charte constitue une violation des textes applicables.</p><p><i><strong>15 – Communication relative à une violation de données à caractère personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Si nous constatons une faille de sécurité dans le traitement de vos données susceptibles d’entraîner un risque élevé pour vos droits et libertés, nous vous en informerons dans les meilleurs délais (article 34 du RGPD). Nous vous détaillerons à cette occasion la nature de la violation rencontrée et les mesures mise en place pour y mettre un terme.</p><p><i><strong>16 – Modifications</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Nous nous réservons le droit, à notre seule discrétion, de modifier à tout moment la présente charte, en totalité ou en partie. Ces modifications entreront en vigueur à compter de la publication de la nouvelle charte. Votre utilisation de la Plateforme suite à l’entrée en vigueur de ces modifications vaudra reconnaissance et acceptation de la nouvelle charte. A défaut et si cette nouvelle charte ne vous convient pas, vous ne devrez plus accéder à la Plateforme.</p><p><i><strong>17 – Entrée en vigueur</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">La présente charte est entrée en vigueur le&nbsp;<strong>24 Mai 2018</strong>.</p>'),
(10, 'Nous contacter', '<p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><span style=\"color:hsl(0, 75%, 60%);\">Fonction</span></td><td>Président</td><td>WebMaster</td></tr><tr><td><span style=\"color:hsl(0, 75%, 60%);\">Nom et prénom</span></td><td>Dominque Lazure</td><td>Guy Verghote</td></tr><tr><td><span style=\"color:hsl(0, 75%, 60%);\">Adresse mail</span></td><td><span style=\"color:rgb(0,0,0);\">lazure@free.Fr</span></td><td>guy.verghote@free.fr</td></tr><tr><td><span style=\"color:hsl(0, 75%, 60%);\">Téléphone</span></td><td>&nbsp;</td><td>&nbsp;</td></tr></tbody></table></figure>'),
(11, 'Agenda', '<p>Agenda du club</p><p><span style=\"color:red;\">Vendredi 11 septembre</span></p><p><span style=\"color:#2F5597;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; salon AGORA</span></p><p style=\"margin-left:3.0cm;\">Nous cherchons des volontaires pour tenir le stand de 15 heures à 19 heures</p><p style=\"margin-left:3.0cm;\">&nbsp;</p><p><span style=\"color:red;\">Merdredi 16 septembre</span></p><p><span style=\"color:#4472C4;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Run2k challenge</span></p><p style=\"margin-left:3.0cm;\">Portes ouvertes au stade de camon pour faire découvrir le club</p><p style=\"margin-left:3.0cm;\">&nbsp;</p><p><span style=\"color:red;\">Merdredi 23 septembre</span></p><p><span style=\"color:#4472C4;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Soirée piste en remplacement du relay Medley</span></p><p style=\"margin-left:3.0cm;\">au programme 1000, 1500 et 3000m<br>&nbsp;</p>');
INSERT INTO `page` (id, nom, contenu) VALUES
(12, 'Règlement', '<figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><figure class=\"table\"><table><tbody><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 1 :</strong></span><span style=\"color:black;\">&nbsp;Les courses pédestres des 4 saisons d\'Amiens métropole sont organisées par le club sportif Amicale du Val de Somme, affilié à la Fédération française d\'athlétisme.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 2 :</strong></span><span style=\"color:black;\">&nbsp;Elles sont organisées 4 fois par an et proposent aux participants différentes épreuves sur des parcours dont le mesurage a été homologué officiellement par la FFA. En général il s\'agit d\'une épreuve de 5 km et de 2 épreuves de 10km selon le niveau des participants (joggers ou As). Une épreuve plus courte peut être proposée pour les jeunes.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 3 :</strong></span><span style=\"color:black;\">&nbsp;Le site des compétitions se situe au parc du grand marais si le terrain le permet, des parcours de substitution peuvent être éventuellement utilisés.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 4 :</strong></span><span style=\"color:black;\">&nbsp;Les participants doivent s\'acquitter d\'un droit d\'inscription à l\'épreuve dont le montant est fixé pour chaque course par le Conseil d\'administration de l\'Amicale du Val de Somme. Ils ont la possibilité de s\'inscrire via le site du club, www.valdesomme.net, sous condition de régler leur taxe et de présenter les justificatifs lors du retrait de dossard avant leur épreuve.</span><br><span style=\"color:black;\">Pour les mineurs non licenciés une autorisation parentale signée devra être fournie.</span><br><span style=\"color:black;\">En cas de forfait, le montant de l\'inscription reste acquis à l\'organisation.</span><br><span style=\"color:black;\">L\'organisation se réserve le droit du supprimer toute inscription comportant des termes portant atteinte à l\'image ou la réputation de la course, aux bonnes mœurs, injurieux, racistes ou homophobes.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 5 :</strong></span><span style=\"color:black;\">&nbsp;L\'organisation s\'engage à respecter le règlement national des épreuves hors stade édité annuellement par la FFA, en particulier quant au contrôle des licences, des certificats médicaux, des distances maximales autorisées selon les catégories d\'âge, la prise d\'une assurance en responsabilité civile. Les coureurs licenciés bénéficient des garanties liées à leur licence, il importe aux autres participants de s\'assurer personnellement. Les différentes épreuves sont inscrites au calendrier de la FFA et font l\'objet d\'un arrêté préfectoral d\'autorisation.</span><br><span style=\"color:black;\">Seules les licences de la FFA, de la fédération Triathlon, et de la fédération UFOLEP athlétisme ou courses sur routes sont admises.</span><br><span style=\"color:black;\">Pour les coureurs non licenciés, le certificat médical sera daté de moins d\'un an à la date de l\'épreuve et comportera obligatoirement la mention de non contre-indication à la pratique de la course à pied en compétition, ou de non contre-indication à la pratique de l\'athlétisme en compétition.</span><br><span style=\"color:black;\">La présentation d\'un certificat médical sur smartphone ou tout autre dispositif numérique lors du retrait du dossard n\'est pas autorisée, l\'organisateur étant tenu de garder et archiver les certificats médicaux.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 6 :</strong></span><span style=\"color:black;\">&nbsp;Les concurrents masculins des 10km joggers ne seront chronométrés qu\'à partir d\'une durée de course de 44 minutes. Tout concurrent de cette épreuve franchissant la ligne d\'arrivée en moins de 44 minutes se verra attribuer sur le classement un temps de 44 mn 00 sec.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 7 :</strong></span><span style=\"color:black;\">&nbsp;Toute contestation ou réclamation devra être soumise au juge arbitre de l\'épreuve et étudiée par le jury désigné à cet effet. Les concurrents sont tenus de respecter le parcours balisé et de contourner les cônes de Lubeck dans les virages. Tout concurrent n\'ayant pas respecté le parcours balisé dans son intégrité sera disqualifié.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 8 :</strong></span><span style=\"color:black;\">&nbsp;Les horaires des courses seront publiés sur le site de l\'Amicale du Val de Somme et le bulletin d\'inscription aux épreuves.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 9 :</strong></span><span style=\"color:black;\">&nbsp;En cas d\'utilisation de transpondeurs pour les classements, aucune réclamation ne sera admise pour non classement en cas de perte ou non port du transpondeur à la chaussure.</span><br><span style=\"color:black;\">La non restitution du transpondeur sera facturée 10 euros au concurrent par courrier et en cas de non paiement le concurrent se verra refuser toute nouvelle inscription aux éditions suivantes.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 10 :</strong></span><span style=\"color:black;\">&nbsp;Droit d\'image : Les participants autorisent expressément l\'Amicale du Val de Somme ainsi que ses ayant-droits, tels que partenaires et médias, à utiliser les images fixes ou audiovisuelles sur lesquelles ils pourraient apparaître, prises à l\'occasion de leur participation aux épreuves des 4 Saisons d\'Amiens métropole, sur tous les supports y compris les documents promotionnels et/ou publicitaires.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 11 :</strong></span><span style=\"color:black;\">&nbsp;Les résultats sont publiés dans les meilleurs délais sur le site de l\'Amicale du Val de Somme puis diffusés aux supports habituels (sites du CDA80 et de Courses80).</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 12 :</strong></span><span style=\"color:black;\">&nbsp;La sécurité des concurrents interdit la circulation sur le parcours à tous véhicules motorisés, sauf pour les secours d\'urgence. Une procédure de mise en place des premiers soins d\'urgence est rédigée, le SAMU du CHR d\'Amiens (tél 15) peut être mobilisé rapidement sur appel.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 13 :</strong></span><span style=\"color:black;\">&nbsp;Les épreuves concernent uniquement les athlètes pratiquant la course à pied.</span><br><span style=\"color:black;\">Les épreuves ne sont pas ouvertes aux personnes utilisant des engins handisports, des bâtons de marche (marche nordique), des engins à roulettes (type rollers, planches ou dérivés), les engins tractés, portés ou poussés.</span><br><span style=\"color:black;\">Les chiens même tenus en laisse ne sont pas autorisés.</span><br><span style=\"color:black;\">Les accompagnateurs en bicyclette ne sont pas autorisés sous peine de disqualification du coureur assisté.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:#00469C;\"><strong>Article 14 :</strong></span><span style=\"color:black;\">&nbsp;L\'attribution du dossard est nominative et non cessible.</span><br><span style=\"color:black;\">Le port du dossard accroché sur le devant du maillot par des épingles est obligatoire sous peine de disqualification. Tout dossard non distinctement visible durant l\'épreuve et particulièrement dans les 50 derniers mètres de la course avant l\'arrivée entraînera une disqualification immédiate du concurrent sans possibilité de réclamation.</span></p></td></tr><tr><td>&nbsp;</td></tr><tr><td><p style=\"margin-left:0cm;\"><span style=\"color:black;\">Règlement établi le 07.02.2011 et validé par le conseil d\'administration de l\'Amicale du Val de Somme.</span></p></td></tr></tbody></table></figure><p>&nbsp;</p>');
