CREATE DATABASE IF NOT EXISTS vds ;
USE vds;

CREATE TABLE administrateur (
  id int(11) NOT NULL
) ENGINE=InnoDB;

CREATE TABLE categorie (
  id varchar(3) NOT NULL,
  nom varchar(20) NOT NULL,
  agemin tinyint(4) NOT NULL,
  agemax tinyint(4) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE classement (
  id smallint(5) UNSIGNED NOT NULL,
  date date NOT NULL,
  nom varchar(50)  NOT NULL,
  distance varchar(22)  NOT NULL,
  nbParticipant smallint(5) UNSIGNED NOT NULL
) ENGINE=InnoDB;


CREATE TABLE coureur (
  id int(11) NOT NULL,
  nom varchar(50) NOT NULL,
  prenom varchar(50) NOT NULL,
  annee char(4) NOT NULL,
  sexe char(1) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE course (
  id int(11) NOT NULL,
  date date NOT NULL,
  distance varchar(5) NOT NULL,
  nbParticipant int(11) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE document (
  id int(11) NOT NULL,
  titre varchar(150) NOT NULL,
  idType smallint(6) NOT NULL,
  dateCreation datetime NOT NULL
) ENGINE=InnoDB;


CREATE TABLE droit (
  idAdministrateur int(11) NOT NULL,
  idFonction int(11) NOT NULL
) ENGINE=InnoDB;

CREATE TABLE epreuve (
  id int(11) NOT NULL,
  nom varchar(100) NOT NULL,
  description text,
  date date NOT NULL
) ENGINE=InnoDB;


CREATE TABLE fonction (
  id int(11) NOT NULL,
  nom varchar(100) NOT NULL,
  fichier varchar(60) NOT NULL,
  menu enum('Ajouter','Gérer') NOT NULL DEFAULT 'Gérer',
  description varchar(150) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE information (
  id int(11) NOT NULL,
  titre varchar(70) NOT NULL,
  contenu mediumtext NOT NULL,
  auteur varchar(50) NOT NULL,
  idType smallint(6) NOT NULL,
  dateCreation datetime NOT NULL
) ENGINE=InnoDB;


CREATE TABLE lien (
  id int(11) NOT NULL,
  nom varchar(50) NOT NULL,
  description varchar(500) DEFAULT NULL,
  url varchar(150) NOT NULL,
  rang int(11) NOT NULL DEFAULT '1',
  logo varchar(70) DEFAULT NULL
) ENGINE=InnoDB;


CREATE TABLE lienffa (
  id int(11) NOT NULL,
  titre varchar(200) NOT NULL,
  url varchar(350) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE membre (
  id int(11) NOT NULL,
  nom varchar(30) NOT NULL,
  prenom varchar(50) NOT NULL,
  sexe char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT 'M',
  dateNaissance date DEFAULT NULL,
  licence varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  montantLicence int(11) DEFAULT NULL,
  email varchar(100) NOT NULL,
  fixe varchar(10) DEFAULT NULL,
  mobile varchar(10) DEFAULT NULL,
  password varchar(15) NOT NULL DEFAULT '1111',
  photo varchar(50) DEFAULT NULL,
  abtInfoClub tinyint(4) DEFAULT '0',
  abtInfo4S tinyint(4) DEFAULT '0',
  abtInfoMembre tinyint(4) DEFAULT '0',
  abtInfoPublic tinyint(4) DEFAULT '0',
  autMail tinyint(4) DEFAULT '0',
  autFixe tinyint(4) DEFAULT '0',
  autMobile tinyint(4) DEFAULT '0',
  autPhoto tinyint(4) DEFAULT '0',
  saison int(11) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE message (
  id int(11) NOT NULL,
  nomPrenom varchar(70) NOT NULL,
  email varchar(100) NOT NULL,
  message text NOT NULL,
  dateReponse date DEFAULT NULL,
  auteur varchar(50) DEFAULT NULL,
  reponse text,
  dateCreation date NOT NULL
) ENGINE=InnoDB;


CREATE TABLE `page` (
  id int(11) NOT NULL,
  nom varchar(30) NOT NULL,
  contenu text NOT NULL
) ENGINE=InnoDB;


CREATE TABLE parametre (
  saison int(11) NOT NULL,
  debutSaison date NOT NULL,
  finSaison date NOT NULL,
  emailContact varchar(50) NOT NULL,
  nomAssociation varchar(50) NOT NULL,
  nomPresident varchar(50) NOT NULL,
  siege varchar(100) DEFAULT NULL,
  rue varchar(100) NOT NULL,
  ville varchar(50) NOT NULL,
  debutAdhesion date DEFAULT NULL,
  finAdhesion date DEFAULT NULL,
  moisFfa int(11) NOT NULL DEFAULT '11',
  code char(64) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE partenaire (
  id smallint(6) NOT NULL,
  nom varchar(100) NOT NULL,
  domaine smallint(6) NOT NULL DEFAULT '1',
  logo varchar(40) DEFAULT NULL
) ENGINE=InnoDB;


CREATE TABLE reportage (
  id int(11) NOT NULL,
  date date NOT NULL,
  titre varchar(200) NOT NULL,
  url varchar(150) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE resultat (
  idCourse int(11) NOT NULL,
  place int(11) NOT NULL,
  idCoureur int(11) NOT NULL,
  categorie varchar(3) DEFAULT NULL,
  placeCategorie int(11) DEFAULT NULL,
  temps time NOT NULL,
  club varchar(75) DEFAULT NULL
) ENGINE=InnoDB;


CREATE TABLE `type` (
  id smallint(6) NOT NULL,
  nom varchar(10) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE typedocument (
  id smallint(6) NOT NULL,
  nom varchar(10) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE typeinformation (
  id smallint(6) NOT NULL,
  nom varchar(10) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE typelicence (
  id int(11) NOT NULL,
  nom varchar(15) NOT NULL,
  tarif int(11) NOT NULL
) ENGINE=InnoDB;



