ALTER TABLE administrateur
  ADD CONSTRAINT administrateur_ibfk_1 FOREIGN KEY (id) REFERENCES membre (id) ON DELETE CASCADE ON UPDATE CASCADE;

ALTER TABLE document
  ADD CONSTRAINT document_ibfk_1 FOREIGN KEY (idType) REFERENCES typedocument (id);

ALTER TABLE droit
  ADD CONSTRAINT droit_ibfk_1 FOREIGN KEY (idAdministrateur) REFERENCES membre (id) ON DELETE CASCADE ON UPDATE CASCADE,
  ADD CONSTRAINT droit_ibfk_2 FOREIGN KEY (idFonction) REFERENCES fonction (id) ON DELETE CASCADE ON UPDATE CASCADE;

ALTER TABLE information
  ADD CONSTRAINT information_ibfk_1 FOREIGN KEY (idType) REFERENCES typeinformation (id);


